import React from 'react';
import './App.css';
import {Layout, Button} from 'antd';

function App() {
  return (
    <div className="App">
      <Layout>
        <Header className="header">
          <h1 className="title">Ant Design Rocks!</h1>
        </Header>
      </Layout>
    </div>
  );
}

export default App;
